import React, { Component } from 'react';
import '../App.css'
import Barre_nav from "./barre_nav/Barre_nav";
import Home from '../page/home/Home';
import './Affichage.css'




function Affichage() {
      return (
    <div>
      <div className="">
        <Barre_nav/>
        <div className="main">
          <Home/>

        </div>
      </div>
    </div>
  );
}

export default Affichage;
